import ReactDOM from 'react-dom/client';
import './index.css';
import Head from './Head';
import Content from './count';
import Foot from'./Footer';

const root = ReactDOM.createRoot(document.getElementById('root'));
    root.render(
  <React.StrictMode>
      <div >

    <Head />
    <Content/>
    <Foot/>
    </div>

</React.StrictMode>
);
